import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-746.5 Special license plates for National Guard retirees; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-746.5.md","filePath":"vacode/46.2-746.5.md"}'),i={name:"vacode/46.2-746.5.md"},s=t('<h1 id="§-46-2-746-5-special-license-plates-for-national-guard-retirees-fees" tabindex="-1">§ 46.2-746.5 Special license plates for National Guard retirees; fees. <a class="header-anchor" href="#§-46-2-746-5-special-license-plates-for-national-guard-retirees-fees" aria-label="Permalink to &quot;§ 46.2-746.5 Special license plates for National Guard retirees; fees.&quot;">​</a></h1><p>On receipt of an application and written evidence that the applicant is a retired member of the National Guard, the Commissioner shall issue special license plates to National Guard retirees.</p><p>No fee shall be charged for license plates issued under the provisions of this section to retired members of the Virginia National Guard.</p><p>The fee for non-Virginia National Guard retirees shall be $10 per year plus the prescribed cost for state license plates, unless the plates bear reserved numbers or letters as provided for in § <a href="/vacode/46.2-726/">46.2-726</a>. In this latter case, such license plates shall be subject to an additional charge of $10 per year for the reserved numbers or letters.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0774" target="_blank" rel="noreferrer">774</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0128" target="_blank" rel="noreferrer">128</a>.</p>',5),l=[s];function n(o,c,p,f,d,h){return a(),r("div",null,l)}const g=e(i,[["render",n]]);export{u as __pageData,g as default};
